import '../styles/thanks.css';
import IMAGE from './image';
import forever from '../images/header.jpg';

const ThankYou = () => {
    return ( 
        <div className="thanks">
            <div className="head">
            <IMAGE size="1" image={forever} alt="Forever Living" class="head"/>
            </div>
            <div className="body">
                <p className="bigger-text">ORDER HAS BEEN PLACED SUCCESSFULLY</p>
            </div>
        </div>
     );
}
 
export default ThankYou;
